import React from "react";

const Footer: React.FC = () => {
  return (
    <footer className="footer">
      <div className="footer-container">
        {/* Social Icons */}
        <div className="social-icons">
          <a
            href="https://www.linkedin.com/in/sheik-saqib-ahmed-8178382a6"
            target="_blank"
            rel="noreferrer"
            aria-label="LinkedIn"
          >
            {/* LinkedIn SVG */}
            <svg xmlns="http://www.w3.org/2000/svg" fill="currentColor" className="icon" viewBox="0 0 24 24">
              <path d="M19 0h-14c-2.761..."></path>
            </svg>
          </a>

          <a
            href="https://github.com/sheiksaqibahmed"
            target="_blank"
            rel="noreferrer"
            aria-label="GitHub"
          >
            {/* GitHub SVG */}
            <svg xmlns="http://www.w3.org/2000/svg" fill="currentColor" className="icon" viewBox="0 0 24 24">
              <path d="M12 .5c-6.627 0..."></path>
            </svg>
          </a>

          <a
            href="https://www.instagram.com/saqib_sheik?igsh=MXBzZWVmZHJxMHpmOQ=="
            target="_blank"
            rel="noreferrer"
            aria-label="Instagram"
          >
            {/* Instagram SVG */}
            <svg xmlns="http://www.w3.org/2000/svg" fill="currentColor" className="icon" viewBox="0 0 24 24">
              <path d="M12 2.163c3.204 0..."></path>
            </svg>
          </a>

          <a href="mailto:sheiksaqibahmed@gmail.com" aria-label="Email">
            {/* Email SVG */}
            <svg xmlns="http://www.w3.org/2000/svg" fill="currentColor" className="icon" viewBox="0 0 24 24">
              <path d="M0 4v16h24v-16h-24zm22..."></path>
            </svg>
          </a>
        </div>

        {/* Footer Text */}
        <p className="footer-text">
          Â© {new Date().getFullYear()} Sheik Saqib Ahmed | All Rights Reserved
        </p>
      </div>

      {/* Inline CSS */}
      <style>{`
        .footer {
          margin-top: 40px;
          padding: 20px 0;
          background: #143a50ff;
          color: #fff;
          text-align: center;
        }
        .footer-container {
          max-width: 900px;
          margin: 0 auto;
        }
        .social-icons {
          display: flex;
          justify-content: center;
          gap: 20px;
          margin-bottom: 12px;
        }
        .icon {
          width: 28px;
          height: 28px;
          cursor: pointer;
          transition: transform 0.2s, color 0.2s;
        }
        .icon:hover {
          transform: scale(1.2);
          color: #00aced;
        }
        .footer-text {
          font-size: 14px;
          color: #aaa;
        }
      `}</style>
    </footer>
  );
};

export default Footer;
